package tlb

import (
	"reflect"
	"testing"

	"github.com/tonkeeper/tongo/boc"
)

func TestConfigParams_CloneKeepingSubsetOfKeys(t *testing.T) {
	cfg := ""
	tests := []struct {
		name         string
		boc          string
		keys         []uint32
		expectedKeys map[uint32]struct{}
	}{
		{
			boc:  cfg,
			keys: []uint32{0, 1, 15},
			expectedKeys: map[uint32]struct{}{
				0:  {},
				1:  {},
				15: {},
			},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			cell, err := boc.DeserializeSinglRootBase64(tt.boc)
			if err != nil {
				t.Fatalf("DeserializeSinglRootBase64() error: %v", err)
			}
			var params ConfigParams
			if err := Unmarshal(cell, &params); err != nil {
				t.Fatalf("Unmarshal() error: %v", err)
			}
			clone := params.CloneKeepingSubsetOfKeys(tt.keys)
			clonedKeys := make(map[uint32]struct{})
			for _, item := range clone.Config.Items() {
				clonedKeys[uint32(item.Key)] = struct{}{}
			}
			if !reflect.DeepEqual(clonedKeys, tt.expectedKeys) {
				t.Fatalf("expected keys: %v, got keys: %v", tt.expectedKeys, clonedKeys)
			}
		})
	}
}
